<?phpnamespace Nemundo\Content\App\Location\Install;use Nemundo\App\Application\Setup\ApplicationSetup;use Nemundo\App\WebService\Setup\ServiceRequestSetup;use Nemundo\Content\App\Location\Application\LocationApplication;use Nemundo\Content\App\Location\Content\Address\AddressContentType;use Nemundo\Content\App\Location\Content\Location\LocationContentType;use Nemundo\Content\App\Location\Data\LocationModelCollection;use Nemundo\Content\App\Location\Service\AddressPostService;use Nemundo\Content\App\Location\Service\LocationPostService;use Nemundo\Content\App\Location\Service\TrackingDeleteService;use Nemundo\Content\App\Location\Service\TrackingListService;use Nemundo\Content\App\Location\Service\TrackingPostService;use Nemundo\Content\Index\Geo\Setup\GeoContentTypeSetup;use Nemundo\Content\Setup\ContentTypeSetup;use Nemundo\Model\Setup\ModelCollectionSetup;use Nemundo\App\Application\Type\Install\AbstractInstall;class LocationInstall extends AbstractInstall{    public function install()    {        (new ApplicationSetup())            ->addApplication(new LocationApplication());        (new ModelCollectionSetup())            ->addCollection(new LocationModelCollection());        (new ContentTypeSetup(new LocationApplication()))            ->addContentType(new AddressContentType())            ->addContentType(new LocationContentType());        (new GeoContentTypeSetup(new LocationApplication()))            ->addContentType(new LocationContentType());        (new ServiceRequestSetup(new LocationApplication()))            ->addService(new LocationPostService())            ->addService(new TrackingPostService())            ->addService(new AddressPostService())            ->addService(new TrackingDeleteService())            ->addService(new TrackingListService());    }}